import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Notes from "./Notes";
import notes from "../notes"

function createNotes(e){
    <Notes 
      title={e.title}
      content={e.content}
    />
}
function App(){
   return (<>
   <Header /> 
   <div>
   {notes.map(createNotes)}
   </div>
   <Notes />
   <Footer />
   </>)
}
export default App;
